import { useState } from "react";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const navigate = useNavigate();

  return (
    <div className="min-h-screen bg-gray-100 flex flex-col items-center py-10">
      <h1 className="text-3xl font-bold mb-6">Master Dashboard</h1>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-6">
        <div
          className="bg-white shadow-lg rounded-lg p-6 cursor-pointer hover:shadow-2xl transition"
          onClick={() => navigate("/donor-master")}
        >
          <h2 className="text-xl font-semibold">Donor Master</h2>
          <p className="text-gray-600 mt-2">Manage donor details</p>
        </div>
        {/* Other Master Categories can be added here */}
      </div>
    </div>
  );
};

export default Dashboard;
